function Row({row}) {
  return (
    // <tr>
    //   {rows.map((row) => (
    //     <td key={row.id}>{row.id}</td>
    //   ))}
    // </tr>
    <tr>
      <td>{row.name}</td>
      <td>{row.email}</td>
      <td>{row.phoneNumber}</td>
      <td>{row.houseYard}</td>
      <td>{row.suite}</td>
      <td>{row.classYear}</td>
      <td>{row.homeCity}</td>
      <td>{row.homeState}</td>
      <td>
        test
        {/* <DropdownButton id="dropdown-basic-button" title="Contact Status">
